import logo from './logo.svg';
import './App.css';
import { Editor } from '@tinymce/tinymce-react';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>hello_world</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
